contracts/HemShopV1.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/proxy/utils/Initializable.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import './interfaces/IHemShop.sol';
import './interfaces/IUserSellerManager.sol';
import './interfaces/IProductManager.sol';
import './interfaces/ICategoryManager.sol';
import './interfaces/IReviewManager.sol';
import './interfaces/IPurchaseManager.sol';

contract HemShopV1 is Initializable, Ownable, ReentrancyGuard, ERC721 {
    IUserSellerManager public userSellerManager;
    IProductManager public productManager;
    ICategoryManager public categoryManager;
    IReviewManager public reviewManager;
    IPurchaseManager public purchaseManager;

    uint256 public servicePct;

    constructor() ERC721("HemShop", "Hsp") {}

    function initialize(
        address _userSellerManager,
        address _productManager,
        address _categoryManager,
        address _reviewManager,
        address _purchaseManager,
        uint256 _servicePct
    ) public initializer {
        userSellerManager = IUserSellerManager(_userSellerManager);
        productManager = IProductManager(_productManager);
        categoryManager = ICategoryManager(_categoryManager);
        reviewManager = IReviewManager(_reviewManager);
        purchaseManager = IPurchaseManager(_purchaseManager);
        servicePct = _servicePct;
        
        productManager.setHemShop(address(this));
        reviewManager.setHemShop(address(this));
        purchaseManager.setHemShop(address(this));
    }

    // --- User & Seller Management ---
    
    function registerUser(
        string memory name,
        string memory email,
        string memory avatar
    ) external {
        userSellerManager.registerUser(name, email, avatar);
    }

    function registerSeller(
        string memory businessName,
        string memory description,
        string memory email,
        string memory phone,
        string memory logo
    ) external {
        userSellerManager.registerSeller(businessName, description, email, phone, logo);
    }

    function getAllRegisteredSellers() external view returns (address[] memory) {
        return userSellerManager.getAllRegisteredSellers();
    }

    function getUser(
        address user
    ) external view returns (
        bool isRegistered,
        IUserSellerManager.UserProfile memory profile,
        bool isUserSeller,
        IHemShop.SellerStatus sellerState
    ) {
        return userSellerManager.getUser(user);
    }

    function getSeller(
        address seller
    ) external view returns (
        IUserSellerManager.SellerProfile memory profile,
        IHemShop.SellerStatus status,
        bool isRegistered
    ) {
        return userSellerManager.getSeller(seller);
    }

    // --- Product Management ---

    function createProduct(IHemShop.ProductInput calldata input) external {
        uint256 newProductId = productManager.createProduct(input);
        _mint(msg.sender, newProductId);
    }

    function updateProduct(uint256 productId, IHemShop.ProductInput calldata input) external {
        productManager.updateProduct(productId, input);
    }

    function deleteProduct(uint256 productId) external {
        productManager.deleteProduct(productId);
    }

    // --- Category Management ---
    
    function createCategory(string memory name) external onlyOwner {
        categoryManager.createCategory(name);
    }

    function createSubCategory(uint256 parentId, string memory name) external onlyOwner {
        categoryManager.createSubCategory(parentId, name);
    }

    function createSubCategoriesBulk(uint256 parentId, string[] calldata names) external onlyOwner {
        categoryManager.createSubCategoriesBulk(parentId, names);
    }

    function getAllCategories() external view returns (
        uint256[] memory ids,
        string[] memory names,
        bool[] memory activeStates,
        uint256[][] memory subCategoryIdArrays
    ) {
        return categoryManager.getAllCategories();
    }

    // --- Review Management ---

    function createReview(uint256 productId, uint256 rating, string memory comment) external {
        reviewManager.createReview(productId, msg.sender, rating, comment);
    }

    function deleteReview(uint256 productId, uint256 reviewId) external {
        reviewManager.deleteReview(productId, reviewId, msg.sender);
    }

    function getReviews(uint256 productId) external view returns (IReviewManager.ReviewStruct[] memory) {
        return reviewManager.getReviews(productId);
    }

    // --- Purchase Management ---

    function buyProduct(
        uint256 productId,
        IHemShop.ShippingDetails calldata shippingDetails,
        string calldata selectedColor,
        string calldata selectedSize,
        uint256 quantity
    ) external payable nonReentrant {
        IProductManager.ProductStruct memory product = productManager.products(productId);
        require(msg.value >= product.price * quantity, "Insufficient payment");

        purchaseManager.recordPurchase(
            productId,
            msg.sender,
            product.seller,
            msg.value,
            product.price * quantity,
            shippingDetails,
            selectedColor,
            selectedSize,
            quantity
        );
    }

    function withdraw() external {
        purchaseManager.withdraw();
    }

    function markPurchaseDelivered(uint256 productId, address buyer) external {
        purchaseManager.markPurchaseDelivered(productId, buyer);
    }

    // --- View Functions ---

    function getProduct(uint256 productId) external view returns (IProductManager.ProductStruct memory) {
        return productManager.getProduct(productId);
    }

    function getAllProducts() external view returns (IProductManager.ProductStruct[] memory) {
        return productManager.getAllProducts();
    }

    function getMyProducts() external view returns (IProductManager.ProductStruct[] memory) {
        return productManager.getMyProducts();
    }

    function getSellerProfile(address seller) external view returns (IUserSellerManager.SellerProfile memory) {
        return userSellerManager.getSellerProfile(seller);
    }

    function getSellerStatus(address seller) external view returns (IHemShop.SellerStatus) {
        return userSellerManager.getSellerStatus(seller);
    }

    function updateSellerStatus(address seller, IHemShop.SellerStatus newStatus) external onlyOwner {
        userSellerManager.updateSellerStatus(seller, newStatus);
    }

    function getBuyerPurchaseHistory(address buyer) external view returns (IHemShop.PurchaseHistoryStruct[] memory) {
        return purchaseManager.getBuyerPurchaseHistory(buyer);
    }

    function getSellerPurchaseHistory(address seller) external view returns (IHemShop.PurchaseHistoryStruct[] memory) {
        return purchaseManager.getSellerPurchaseHistory(seller);
    }

    function getSellerBalance(address seller) external view returns (uint256) {
        return purchaseManager.getSellerBalance(seller);
    }

    function getProductsByCategory(string memory categoryName) external view returns (IProductManager.ProductStruct[] memory) {
        return productManager.getProductsByCategory(categoryName);
    }

    receive() external payable {}
}

