// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/utils/Counters.sol';
import '../interfaces/IHemShop.sol';

contract ProductManager is Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _TotalProducts;
    address public hemShop;

    struct ProductStruct {
        uint256 id;
        address seller;
        string name;
        string description;
        uint256 price;
        uint256 stock;
        string[] colors;
        string[] sizes;
        string[] images;
        string category;
        string subCategory;
        uint256 weight;
        string model;
        string brand;
        uint256 sku;
        bool soldout;
        bool deleted;
    }

    mapping(uint256 => ProductStruct) public products;
    mapping(address => uint256[]) public sellerProducts;
    mapping(uint256 => bool) public productExists;

    event ProductCreated(uint256 indexed id, address indexed seller);
    event ProductUpdated(uint256 indexed id);
    event ProductDeleted(uint256 indexed id);
    event StockUpdated(uint256 indexed productId, uint256 newStock);

    modifier onlyHemShop() {
        require(msg.sender == hemShop, "Only HemShop can call");
        _;
    }

    function setHemShop(address _hemShop) external onlyOwner {
        require(_hemShop != address(0), "Invalid HemShop address");
        hemShop = _hemShop;
    }

    function createProduct(IHemShop.ProductInput calldata input) external returns (uint256) {
        require(bytes(input.name).length > 0, "Name required");
        require(input.price > 0, "Price required");
        require(input.stock > 0, "Stock required");

        _TotalProducts.increment();
        uint256 productId = _TotalProducts.current();

        products[productId] = ProductStruct({
            id: productId,
            seller: msg.sender,
            name: input.name,
            description: input.description,
            price: input.price,
            stock: input.stock,
            colors: input.colors,
            sizes: input.sizes,
            images: input.images,
            category: input.category,
            subCategory: input.subCategory,
            weight: input.weight,
            model: input.model,
            brand: input.brand,
            sku: input.sku,
            soldout: false,
            deleted: false
        });

        productExists[productId] = true;
        sellerProducts[msg.sender].push(productId);

        emit ProductCreated(productId, msg.sender);
        return productId;
    }

    function updateProductStock(uint256 productId, uint256 quantity) external onlyHemShop returns (bool) {
        require(productExists[productId], "Product not found");
        require(!products[productId].deleted, "Product deleted");
        require(products[productId].stock >= quantity, "Insufficient stock");

        products[productId].stock -= quantity;
        if (products[productId].stock == 0) {
            products[productId].soldout = true;
        }

        emit StockUpdated(productId, products[productId].stock);
        return true;
    }

    function getProduct(uint256 productId) public view returns (ProductStruct memory) {
        require(productExists[productId], "Product not found");
        require(!products[productId].deleted, "Product deleted");
        return products[productId];
    }

    function updateProduct(uint256 productId, IHemShop.ProductInput calldata input) external {
        require(products[productId].seller == msg.sender, 'Only seller can update');
        require(productExists[productId], 'Product not found');
        require(!products[productId].deleted, 'Product deleted');

        products[productId].name = input.name;
        products[productId].description = input.description;
        products[productId].price = input.price;
        products[productId].stock = input.stock;
        products[productId].colors = input.colors;
        products[productId].sizes = input.sizes;
        products[productId].images = input.images;
        products[productId].category = input.category;
        products[productId].subCategory = input.subCategory;
        products[productId].weight = input.weight;
        products[productId].model = input.model;
        products[productId].brand = input.brand;
        products[productId].sku = input.sku;

        emit ProductUpdated(productId);
    }

    function deleteProduct(uint256 productId) external {
        require(productExists[productId], 'Product not found');
        require(products[productId].seller == msg.sender || owner() == msg.sender, 'Not authorized');
        require(!products[productId].deleted, 'Already deleted');

        products[productId].deleted = true;
        emit ProductDeleted(productId);
    }

    function getMyProducts() public view returns (ProductStruct[] memory) {
        uint256 count = 0;
        for (uint i = 0; i < sellerProducts[msg.sender].length; i++) {
            uint256 productId = sellerProducts[msg.sender][i];
            if (!products[productId].deleted) count++;
        }

        ProductStruct[] memory myProducts = new ProductStruct[](count);
        uint256 index = 0;
        for (uint i = 0; i < sellerProducts[msg.sender].length; i++) {
            uint256 productId = sellerProducts[msg.sender][i];
            if (!products[productId].deleted) {
                myProducts[index] = products[productId];
                index++;
            }
        }
        return myProducts;
    }

    function getAllProducts() external view returns (ProductStruct[] memory) {
        uint256 count = 0;
        for (uint i = 1; i <= _TotalProducts.current(); i++) {
            if (!products[i].deleted) count++;
        }

        ProductStruct[] memory allProducts = new ProductStruct[](count);
        uint256 index = 0;
        for (uint i = 1; i <= _TotalProducts.current(); i++) {
            if (!products[i].deleted) {
                allProducts[index] = products[i];
                index++;
            }
        }
        return allProducts;
    }

    function getProductsByCategory(string memory categoryName) external view returns (ProductStruct[] memory) {
        uint256 count = 0;
        for (uint256 i = 1; i <= _TotalProducts.current(); i++) {
            if (keccak256(bytes(products[i].category)) == keccak256(bytes(categoryName)) && !products[i].deleted) {
                count++;
            }
        }

        ProductStruct[] memory categoryProducts = new ProductStruct[](count);
        uint256 index = 0;
        for (uint256 i = 1; i <= _TotalProducts.current(); i++) {
            if (keccak256(bytes(products[i].category)) == keccak256(bytes(categoryName)) && !products[i].deleted) {
                categoryProducts[index] = products[i];
                index++;
            }
        }
        return categoryProducts;
    }

    function getSellerProducts(address seller) external view returns (ProductStruct[] memory) {
        uint256 count = 0;
        for (uint256 i = 1; i <= _TotalProducts.current(); i++) {
            if (products[i].seller == seller && !products[i].deleted) {
                count++;
            }
        }

        ProductStruct[] memory sellerProductsList = new ProductStruct[](count);
        uint256 index = 0;
        for (uint256 i = 1; i <= _TotalProducts.current(); i++) {
            if (products[i].seller == seller && !products[i].deleted) {
                sellerProductsList[index] = products[i];
                index++;
            }
        }

        return sellerProductsList;
    }

    function getTotalProducts() external view returns (uint256) {
        return _TotalProducts.current();
    }
}

contracts/management/PurchaseManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/proxy/utils/Initializable.sol';
import '../interfaces/IHemShop.sol';
import '../interfaces/IUserSellerManager.sol';

interface IProductManager {
    struct ProductStruct {
        uint256 id;
        address seller;
        string name;
        string description;
        uint256 price;
        uint256 stock;
        string[] colors;
        string[] sizes;
        string[] images;
        string category;
        string subCategory;
        uint256 weight;
        string model;
        string brand;
        uint256 sku;
        bool soldout;
        bool deleted;
    }

    function products(uint256 productId) external view returns (ProductStruct memory);
    function updateProductStock(uint256 productId, uint256 quantity) external returns (bool);
}

contract PurchaseManager is Ownable, ReentrancyGuard {
    address public hemShop;
    mapping(address => uint256) public sellerBalances;
    mapping(address => IHemShop.PurchaseHistoryStruct[]) public buyerPurchaseHistory;
    mapping(address => IHemShop.PurchaseHistoryStruct[]) public sellerPurchaseHistory;

    uint256 public servicePct;

    IUserSellerManager public userSellerManager;
    IProductManager public productManager;

    event PurchaseRecorded(
        uint256 indexed productId,
        address indexed buyer,
        address indexed seller,
        uint256 totalAmount,
        uint256 basePrice,
        uint256 timestamp
    );
    event DeliveryStatusUpdated(uint256 indexed productId, address indexed buyer, bool isDelivered);
    event BalanceUpdated(address indexed seller, uint256 newBalance);

    constructor(
        uint256 _pct, 
        address _userSellerManager, 
        address _productManager
    ) {
        servicePct = _pct;
        userSellerManager = IUserSellerManager(_userSellerManager);
        productManager = IProductManager(_productManager);
    }

    function setHemShop(address _hemShop) external onlyOwner {
        require(_hemShop != address(0), "Invalid HemShop address");
        hemShop = _hemShop;
    }

    modifier onlyHemShop() {
        require(msg.sender == hemShop, "Only HemShop can call");
        _;
    }

    modifier onlyVerifiedSellerOrOwner() {
        require(
            userSellerManager.getSellerStatus(msg.sender) == IHemShop.SellerStatus.Verified || 
            msg.sender == owner(),
            'Only verified seller or owner allowed'
        );
        _;
    }

    function recordPurchase(
        uint256 productId,
        address buyer,
        address seller,
        uint256 totalAmount,
        uint256 basePrice,
        IHemShop.ShippingDetails memory shippingDetails,
        string memory selectedColor,
        string memory selectedSize,
        uint256 quantity
    ) public onlyHemShop {
        // Need to verify seller status from UserSellerManager
        require(
            userSellerManager.getSellerStatus(seller) == IHemShop.SellerStatus.Verified,
            "Seller not verified"
        );

        // Get product details from ProductManager
        IProductManager.ProductStruct memory product = productManager.products(productId);

        IHemShop.OrderDetails memory orderDetails = IHemShop.OrderDetails({
            name: product.name,
            images: product.images,
            selectedColor: selectedColor,
            selectedSize: selectedSize,
            quantity: quantity,
            category: product.category,
            description: product.description
        });

        IHemShop.PurchaseHistoryStruct memory purchase = IHemShop.PurchaseHistoryStruct({
            productId: productId,
            totalAmount: totalAmount,
            basePrice: basePrice,
            timestamp: block.timestamp,
            lastUpdated: block.timestamp,
            buyer: buyer,
            seller: seller,
            isDelivered: false,
            shippingDetails: shippingDetails,
            orderDetails: orderDetails
        });

        buyerPurchaseHistory[buyer].push(purchase);
        sellerPurchaseHistory[seller].push(purchase);
        sellerBalances[seller] += totalAmount;

        // Update product stock using the interface method
        require(productManager.updateProductStock(productId, quantity), "Failed to update stock");

        emit PurchaseRecorded(productId, buyer, seller, totalAmount, basePrice, block.timestamp);
    }

    function withdraw() external nonReentrant {
        require(userSellerManager.registeredSellers(msg.sender), 'Must be a registered seller');
        uint256 balance = sellerBalances[msg.sender];
        require(balance > 0, 'No balance to withdraw');

        uint256 serviceFee = (balance * servicePct) / 100;
        uint256 sellerAmount = balance - serviceFee;

        sellerBalances[msg.sender] = 0;
        emit BalanceUpdated(msg.sender, 0);

        payTo(owner(), serviceFee);
        payTo(msg.sender, sellerAmount);
    }

    function markPurchaseDelivered(uint256 productId, address buyer) external onlyVerifiedSellerOrOwner {
        bool found = false;

        // Update buyer's purchase history
        for (uint i = 0; i < buyerPurchaseHistory[buyer].length; i++) {
            if (buyerPurchaseHistory[buyer][i].productId == productId) {
                require(!buyerPurchaseHistory[buyer][i].isDelivered, 'Already marked as delivered');
                require(
                    buyerPurchaseHistory[buyer][i].seller == msg.sender || owner() == msg.sender,
                    'Only seller or owner can mark as delivered'
                );
                buyerPurchaseHistory[buyer][i].isDelivered = true;
                found = true;
                break;
            }
        }

        // Update seller's purchase history
        if (found) {
            IProductManager.ProductStruct memory product = productManager.products(productId);
            address seller = product.seller;
            for (uint i = 0; i < sellerPurchaseHistory[seller].length; i++) {
                if (
                    sellerPurchaseHistory[seller][i].productId == productId &&
                    sellerPurchaseHistory[seller][i].buyer == buyer
                ) {
                    sellerPurchaseHistory[seller][i].isDelivered = true;
                    break;
                }
            }

            emit DeliveryStatusUpdated(productId, buyer, true);
        } else {
            revert('Purchase not found');
        }
    }

    function payTo(address to, uint256 amount) internal {
        (bool success, ) = payable(to).call{value: amount}("");
        require(success, "Transfer failed");
    }

    function getSellerBalance(address seller) external view returns (uint256) {
        return sellerBalances[seller];
    }

    function getBuyerPurchaseHistory(address buyer) external view returns (IHemShop.PurchaseHistoryStruct[] memory) {
        return buyerPurchaseHistory[buyer];
    }

    function getSellerPurchaseHistory(address seller) external view returns (IHemShop.PurchaseHistoryStruct[] memory) {
        return sellerPurchaseHistory[seller];
    }
}

