// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/utils/Counters.sol';

contract ReviewManager is Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _TotalReviews;
    address public hemShop;

    struct ReviewStruct {
        uint256 reviewId;
        address reviewer;
        uint256 rating;
        string comment;
        bool deleted;
        uint256 timestamp;
    }

    mapping(uint256 => bool) public reviewExists;
    mapping(uint256 => ReviewStruct[]) private productReviews;

    event ReviewCreated(uint256 indexed productId, uint256 indexed reviewId);
    event ReviewDeleted(uint256 indexed productId, uint256 indexed reviewId);

    modifier onlyHemShop() {
        require(msg.sender == hemShop, "Only HemShop can call");
        _;
    }

    function setHemShop(address _hemShop) external onlyOwner {
        require(_hemShop != address(0), "Invalid HemShop address");
        hemShop = _hemShop;
    }

    function createReview(
        uint256 productId, 
        address reviewer,
        uint256 rating, 
        string memory comment
    ) external onlyHemShop returns (uint256) {
        require(rating > 0 && rating <= 5, 'Rating must be between 1 and 5');
        require(bytes(comment).length > 0, 'Comment cannot be empty');

        _TotalReviews.increment();
        uint256 reviewId = _TotalReviews.current();

        ReviewStruct memory review = ReviewStruct({
            reviewId: reviewId,
            reviewer: reviewer,
            rating: rating,
            comment: comment,
            deleted: false,
            timestamp: block.timestamp
        });

        productReviews[productId].push(review);
        reviewExists[reviewId] = true;

        emit ReviewCreated(productId, reviewId);
        return reviewId;
    }

    function getReviews(uint256 productId) external view returns (ReviewStruct[] memory) {
        uint256 activeCount = 0;
        for (uint i = 0; i < productReviews[productId].length; i++) {
            if (!productReviews[productId][i].deleted) {
                activeCount++;
            }
        }

        ReviewStruct[] memory activeReviews = new ReviewStruct[](activeCount);
        uint256 index = 0;
        for (uint i = 0; i < productReviews[productId].length; i++) {
            if (!productReviews[productId][i].deleted) {
                activeReviews[index] = productReviews[productId][i];
                index++;
            }
        }
        return activeReviews;
    }

    function deleteReview(
        uint256 productId, 
        uint256 reviewId, 
        address caller
    ) external onlyHemShop returns (bool) {
        bool found = false;
        for (uint i = 0; i < productReviews[productId].length; i++) {
            if (productReviews[productId][i].reviewId == reviewId) {
                require(reviewExists[reviewId], 'Review does not exist');
                require(
                    productReviews[productId][i].reviewer == caller || owner() == caller,
                    'Only reviewer or owner can delete'
                );
                require(!productReviews[productId][i].deleted, 'Already deleted');

                productReviews[productId][i].deleted = true;
                found = true;
                emit ReviewDeleted(productId, reviewId);
                break;
            }
        }
        require(found, 'Review not found');
        return true;
    }

    function getReviewById(
        uint256 productId, 
        uint256 reviewId
    ) external view returns (ReviewStruct memory) {
        for (uint i = 0; i < productReviews[productId].length; i++) {
            if (productReviews[productId][i].reviewId == reviewId) {
                require(!productReviews[productId][i].deleted, 'Review is deleted');
                return productReviews[productId][i];
            }
        }
        revert('Review not found');
    }

    function getTotalReviews() external view returns (uint256) {
        return _TotalReviews.current();
    }
}

