// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/access/Ownable.sol';
import '../interfaces/IHemShop.sol';
import '../interfaces/IUserSellerManager.sol';
import './AdminManager.sol';

contract UserSellerManager is IUserSellerManager, Ownable, AdminManager {
    // Lists
    address[] private registeredSellersList;
    address[] public usersList;

    // Mappings
    mapping(address => IUserSellerManager.UserProfile) public userProfiles;
    mapping(address => IUserSellerManager.SellerProfile) public sellerProfiles;
    mapping(address => IHemShop.SellerStatus) public sellerStatus;
    mapping(address => bool) public registeredUsers;
    mapping(address => bool) public override registeredSellers;

    event SellerRegistered(address indexed seller, uint256 timestamp);
    event SellerStatusUpdated(address indexed seller, IHemShop.SellerStatus status);
    event UserRegistered(address indexed user, string name);

    function registerSeller(
        string memory businessName,
        string memory description,
        string memory email,
        string memory phone,
        string memory logo
    ) external override {
        require(!registeredSellers[msg.sender], "Already registered");
        require(bytes(businessName).length > 0, "Business name required");
        require(bytes(email).length > 0, "Email required");
        require(bytes(phone).length > 0, "Phone required");

        sellerProfiles[msg.sender] = IUserSellerManager.SellerProfile({
            businessName: businessName,
            description: description,
            email: email,
            phone: phone,
            logo: logo,
            registeredAt: block.timestamp,
            termsAccepted: true
        });

        registeredSellers[msg.sender] = true;
        sellerStatus[msg.sender] = IHemShop.SellerStatus.Pending;

        if (!isSellerInList(msg.sender)) {
            registeredSellersList.push(msg.sender);
        }

        emit SellerRegistered(msg.sender, block.timestamp);
        emit SellerStatusUpdated(msg.sender, IHemShop.SellerStatus.Pending);
    }

    function registerUser(
        string memory name,
        string memory email,
        string memory avatar
    ) external override {
        require(!registeredUsers[msg.sender], "Already registered");
        require(bytes(name).length > 0, "Name required");
        require(bytes(email).length > 0, "Email required");

        userProfiles[msg.sender] = IUserSellerManager.UserProfile({
            name: name,
            email: email,
            avatar: avatar,
            registeredAt: block.timestamp,
            isActive: true
        });

        registeredUsers[msg.sender] = true;
        usersList.push(msg.sender);
        emit UserRegistered(msg.sender, name);
    }

    function getSellerProfile(address seller) external view override returns (IUserSellerManager.SellerProfile memory) {
        require(registeredSellers[seller], 'Seller not registered');
        return sellerProfiles[seller];
    }

    function getSellerStatus(address seller) external view override returns (IHemShop.SellerStatus) {
        require(seller != address(0), 'Invalid seller address');
        if (seller == owner()) {
            return IHemShop.SellerStatus.Verified;
        }
        return sellerStatus[seller];
    }

    function updateSellerStatus(address seller, IHemShop.SellerStatus newStatus) external override onlyOwner {
        require(registeredSellers[seller], 'Seller not registered');
        require(newStatus != IHemShop.SellerStatus.Unverified, 'Cannot set status to Unverified');
        require(sellerStatus[seller] != newStatus, 'Seller already has this status');

        sellerStatus[seller] = newStatus;
        emit SellerStatusUpdated(seller, newStatus);
    }

    function getSeller(
        address seller
    ) external view override returns (
        IUserSellerManager.SellerProfile memory profile,
        IHemShop.SellerStatus status,
        bool isRegistered
    ) {
        require(seller != address(0), 'Invalid address');

        return (
            sellerProfiles[seller],
            sellerStatus[seller],
            registeredSellers[seller]
        );
    }

    function getUser(
        address user
    ) external view override returns (
        bool isRegistered,
        UserProfile memory profile,
        bool isUserSeller,
        IHemShop.SellerStatus sellerState
    ) {
        isRegistered = registeredUsers[user];
        profile = userProfiles[user];
        isUserSeller = registeredSellers[user];
        sellerState = isUserSeller ? sellerStatus[user] : IHemShop.SellerStatus.Unverified;

        return (isRegistered, profile, isUserSeller, sellerState);
    }

    function getAllRegisteredSellers() external view override returns (address[] memory) {
        return registeredSellersList;
    }

    function isSellerInList(address seller) internal view returns (bool) {
        for (uint i = 0; i < registeredSellersList.length; i++) {
            if (registeredSellersList[i] == seller) {
                return true;
            }
        }
        return false;
    }

    function setHemShop(address hemShop) external onlyOwner {
        // Implementation if needed
    }
}

